                public override string FormatNumberAsOrdinal(uint value, Gender? gender)
                {
                    // init
                    string suffix = null;

                    // conditions
                    if ((value % 100) == 13)
                        suffix = null;
                    else if ((value % 100) == 12)
                        suffix = null;
                    else if ((value % 100) == 11)
                        suffix = null;
                    else if ((value % 10) == 3)
                        suffix = null;
                    else if ((value % 10) == 2)
                        suffix = null;
                    else if ((value % 10) == 1)
                        suffix = null;

                    // done
                    return string.Format("{0}{1}", value, suffix);
                }
