                public override string FormatNumberAsOrdinal(uint value, Gender? gender)
                {
                    // init
                    string suffix = "th";

                    // conditions
                    if ((value % 100) == 13)
                        suffix = "th";
                    else if ((value % 100) == 12)
                        suffix = "th";
                    else if ((value % 100) == 11)
                        suffix = "th";
                    else if ((value % 10) == 3)
                        suffix = "rd";
                    else if ((value % 10) == 2)
                        suffix = "nd";
                    else if ((value % 10) == 1)
                        suffix = "st";

                    // done
                    return string.Format("{0}{1}", value, suffix);
                }
