                        case 7:
                            return "seventh";
                        case 8:
                            return "eighth";
                        case 9:
                            return "ninth";
                        case 10:
                            return "tenth";
                        default:
                            return this.FormatNumberAsOrdinal(value, gender);
                    }
                }
