                    else if ((value % 100) == 12)
                        suffix = "de";
                    else if ((value % 100) == 11)
                        suffix = "de";
                    else if ((value % 100) == 10)
                        suffix = "de";
                    else if ((value % 100) == 9)
                        suffix = "de";
                    else if ((value % 100) == 7)
                        suffix = "de";
                    else if ((value % 100) == 6)
                        suffix = "de";
                    else if ((value % 100) == 5)
                        suffix = "de";
                    else if ((value % 100) == 4)
                        suffix = "de";
                    else if ((value % 100) == 3)
                        suffix = "de";
                    else if ((value % 100) == 2)
