                public override IEnumerable<DatePartParameters> GetDatePartsAsNumeric(Parameters p)
                {
                    yield return new DatePartParameters("<datepart>(17, 6)", p, DatePartName.Day, DatePartFormat.NumericLeadingZeros, null, "/", null);
                    yield return new DatePartParameters("<datepart>(18, 6)", p, DatePartName.Month, DatePartFormat.NumericLeadingZeros, null, "/", null);
                    yield return new DatePartParameters("<datepart>(19, 6)", p, DatePartName.Year, DatePartFormat.Long, null, null, null);
                }
                public override IEnumerable<DatePartParameters> GetDatePartsAsText(Parameters p)
                {
                    yield return new DatePartParameters("<datepart>(12, 6)", p, DatePartName.Day, DatePartFormat.Numeric, null, " de ", null);
                    yield return new DatePartParameters("<datepart>(13, 6)", p, DatePartName.Month, DatePartFormat.Long, null, " de ", null);
                    yield return new DatePartParameters("<datepart>(14, 6)", p, DatePartName.Year, DatePartFormat.Long, null, null, null);
                }
                public override string FormatNumberAsOrdinal(uint value, Gender? gender)
                {
                    // init
                    string suffix = (gender.HasValue ? (gender.Value == Gender.Feminine ? ".ª" : ".º") : null);

                    // done
                    return string.Format("{0}{1}", value, suffix);
                }
