                {
                    yield return new DatePartParameters("<datepart>(14, 6)", p, DatePartName.Year, DatePartFormat.Long, null, null, null);
                    yield return new DatePartParameters("<datepart>(15, 6)", p, DatePartName.Month, DatePartFormat.NumericLeadingZeros, "-", null, null);
                    yield return new DatePartParameters("<datepart>(16, 6)", p, DatePartName.Day, DatePartFormat.NumericLeadingZeros, "-", null, null);
                }
                public override IEnumerable<DatePartParameters> GetDatePartsAsText(Parameters p)
                {
                    yield return new DatePartParameters("<datepart>(9, 6)", p, DatePartName.Day, DatePartFormat.NumericLeadingZeros, null, ". ", null);
                    yield return new DatePartParameters("<datepart>(10, 6)", p, DatePartName.Month, DatePartFormat.Long, null, " ", null);
                    yield return new DatePartParameters("<datepart>(11, 6)", p, DatePartName.Year, DatePartFormat.Long, null, ".", null);
                }
                public override string FormatNumberAsOrdinal(uint value, Gender? gender)
                {
                    // init
                    string suffix = "th";

                    // conditions
                    if ((value % 100) == 13)
                        suffix = "th";
                    else if ((value % 100) == 12)
                        suffix = "th";
                    else if ((value % 100) == 11)
                        suffix = "th";
                    else if ((value % 10) == 3)
                        suffix = "rd";
                    else if ((value % 10) == 2)
                        suffix = "nd";
                    else if ((value % 10) == 1)
                        suffix = "st";

                    // done
                    return string.Format("{0}{1}", value, suffix);
                }
                public override string FormatNumberAsLongOrdinal(uint value, Gender? gender)
                {
                    switch (value)
                    {
                        case 1:
                            return "first";
                        case 2:
                            return "second";
                        case 3:
                            return "third";
                        case 4:
                            return "fourth";
                        case 5:
                            return "fifth";
                        case 6:
                            return "sixth";
                        case 7:
                            return "seventh";
                        case 8:
                            return "eighth";
                        case 9:
                            return "ninth";
                        case 10:
                            return "tenth";
                        default:
                            return this.FormatNumberAsOrdinal(value, gender);
                    }
                }
